INSERT INTO `searchengine_lien` VALUES (1,'http://www.reneefleming.com/',6,'Site web officiel','La soprano américaine offre ses actualités sur son site web personnel.'),(2,'http://www.alligator.com/artists/Hound-Dog-Taylor/',7,'La page officielle du bluesman','Le légendaire bluesman de Chicago a été au départ de la plus belle aventure discographique du blues, Alligator Records. '),(3,'http://next.liberation.fr/cinema/0101636311-la-cathedrale-de-beauvois',8,'La crtique du film dans Libération du 19 mai 2010 durant le Festival de Cannes','La première critique du film dans Libération et sous la plume d\'Olivier Seguret, lors de la sélection officielle. '),(4,'http://bibliobs.nouvelobs.com/essais/20110209.OBS7763/des-chanteurs-dans-la-machine-a-cailloux.html',9,'Dominique A écrivain','Comme Albin de la Simone, Bertrand Belin, Mathieu Boogaerts et quelques autres, Dominique A fait partie des chanteurs-écrivains publiés par La Machine à cailloux. \r\n'),(5,'http://next.liberation.fr/musique/01012382210-dominique-a-huit-albums-des-souvenirs-et-des-anecdotes',9,'Dominique A: huit albums, autant d\'histoires','Pour ses vingt ans de carrière, le chanteur ressort ses disques remastérisés enrichis d\'inédits. Et plonge dans sa mémoire pour «Libé».'),(6,'http://www.commentcertainsvivent.com/',9,'Site web officiel sur Dominique A','Dominique A sera prochainement le personnage principal d\'une... BD. Arnaud Le Gouëfflec (déjà croisé chez La Boîte à Ooti) a signé le scénario, et Olivier Balez s\'est chargé du dessin.'),(7,'http://www.lemonde.fr/culture/article/2012/04/10/dominique-a-vers-les-lueurs-de-la-gaite-lyrique_1681978_3246.html',9,'Dominique A vers les lueurs de la Gaîté lyrique','Les chansons du nouvel album de Dominique A, Vers les lueurs - probablement son meilleur en vingt ans de carrière - ont constitué le socle du concert privé qu\'il a donné, mercredi 11 avril à la Gaîté lyrique, à Paris.\r\n'),(8,'http://www.franceculture.fr/emission-dominique-a-2006-04-09.html',9,'Dominique A chez Hélène Hazéra','Dominique A, c\'est évidemment une sensibilité particulière, mais c\'est aussi un chef d\'école, bien qu\'il soit loin de l\'avoir demandé.'),(9,'http://www.lesinrocks.com/2012/01/21/musique/jai-tourne-dans-un-clip-de-dominique-a-113917/',9,'Dominique A sur les Inrocks','J’ai tourné dans un clip de Dominique A.\r\n'),(10,'http://www.rfimusique.com/actu-musique/chanson/album/20120328-dominique',9,'Dominique A et la critique de RFI','Confectionné à Bruxelles, le lumineux nouvel album de Dominique A, Vers les lueurs, propose une pop classieuse aux textes touchants.'),(11,'http://www.letelegramme.com/ig/generales/regions/bretagne/chanson-la-face-b-de-dominique-a-26-06-2012-1751745.php?utm_source=rss_telegramme&utm_medium=rss&utm_campaign=rss&xtor=RSS-52',9,'Dominique A sur le Télégramme de Brest','2012 est une année à marquer d\'une pierreblanche pour DominiqueA. Son dernier album «Vers les lueurs» fait un carton, son bouquin «Yrevenir» a été bien accueilli par la critique.'),(12,'http://www.unidivers.fr/dominique-a-tombees-de-la-nuit-rennes/',9,'Dominique A aux Tombées de la nuit','Si une fois encore les Tombées de la Nuit pourront être nommées, par quelques malveillants, les Tombées de la Pluie, ce ne sera certainement pas à cause de Monsieur A.'),(13,'http://www.philomag.com/les-idees/les-questionnaires-de-socrate/dominique-a-le-faux-sage-1357',9,'Dominique A. Le faux sage','Sans être damné, Dominique Ané (de son vrai nom) a longtemps œuvré à l’écart du grand public, attaché qu’il était à faire bouger les lignes entre chanson d’ici et rock de là-bas.'),(14,'http://www.michaeljackson.com/fr/home',10,'Site web officiel de Michael Jackson','Toutes les informations et les contenus sur la gloire américaine de ces trente dernières années.'),(15,'http://bibliobs.nouvelobs.com/journaliste/14892/jerome-garcin.html',11,'Biblios, la page littéraire du site web du Nouvel Observateur','La tendance de Jérôme Garcin, rédacteur en chef du Nouvel Observateur.'),(16,'http://www.hughmasekela.co.za/',12,'Web site officiel d\'Hugh Masekela ','La maison virtuelle du roi des cuivres sud-africains et ex-époux de la reine de la chanson africaine Miriam Makeba.'),(17,'http://www.afriquinfos.com/articles/2012/11/10/hugh-masekela-selection-musicale-dafriquinfos-212751.asp',12,'La chronique d\'Edem Gadegbeku d\'Afriquinfos','Faisant du jazz et de l’afrobeat, Hugh Ramopolo Masekela, 73 ans est l’une des grandes figures d’attraction de la musique en Afrique du Sud et sur le continent noir depuis plusieurs décennies (56 ans !!!)...'),(18,'http://www.abidjan.net/qui/profil.asp?id=458',12,'La petite bio de Masekela sur Abidjan.net',' Il a joué avec les plus grandes stars de la musique. Il s`initia à la trompette avec le Père Trevor Huddleston, militant anti-apartheid...'),(19,'http://www.charlesaznavour-lesite.fr/L-album',13,'Le site officiel de Charles Aznavour',' Aznavour toujours. Ce n’est pas un titre d’album, c’est un autoportrait. Il y a chez lui quelque chose qui tient du prodige, à la fois pour les altitudes qu’il fréquente et pour sa phénoménale fidélité à son public et à son art...\r\n'),(20,'http://tempsreel.nouvelobs.com/culture/20120408.AFP2776/nouvelle-tournee-nord-americaine-pour-charles-aznavour.html',13,'Nouvel Obs: la tournée américaine d\'Aznavour en 2012','A presque 88 ans, bon pied, bon oeil, celui que les médias anglo-saxons surnomment parfois le Sinatra français se réjouit d\'avance de retrouver le public nord-américain...'),(21,'http://www.letemps.ch/Page/Uuid/ead386b6-d7fe-11e0-bb3b-242652408a2f',13,'Article de Véronique Mortaigne, repris dans Le Temps','Charles Aznavour est devenu un modèle de travail et de réussite, lui qui voulait jeter l’éponge par manque de voix, de physique et de chance…'),(22,'http://next.liberation.fr/culture/01012358730-aznavour-encore',13,'Aznavour dans Libération','De retour à l’Olympia, le chanteur de 87 ans, dans une forme épatante, alterne nouveautés et reprises...'),(23,'http://www.lexpress.to/archives/1247/',13,'Aznavour dans la presse canadienne','Eh bien, si Charles Aznavour a l’intention d’abdiquer, de tourner définitivement le dos à ce métier qui le travaille depuis près de 70 ans, il n’en montre aucun signe sur Colore ma vie (EMI)...'),(24,'http://www.hugues-vassal.com/#!1964---galluis,-france/zoom/c106g/image21ms',13,'Site officiel du photographe Hugues Vassal','Aznavour chez lui à Galluis en 1964, avec son fils Misha...'),(25,'http://www.rfimusique.com/artiste/chanson/charles-aznavour/biographie',13,'Bio de l\'artiste sur le site web de RFI','Ce fils d\'immigrés arméniens est arrivé en haut de l\'affiche à force de volonté. \"Je m\'voyais déjà\" chantait-il en 1960...\r\n'),(26,'http://monsieuraznavour.free.fr/modules.php?ModPath=encapsuleur&ModStart=printenc&eid=15',13,'Piaf et Aznavour','Charles Aznavour raconte Piaf\r\n\"Je vous parle d\'un temps...\" propos recueillis par Amélie De Vriese...\r\n'),(27,'http://www.raoulbreton.fr/',13,'Les éditions Raoul Breton','Charles Aznavour s\'est associé à Gérard Davoust pour reprendre les éditions Raoul Breton, un des plus beau catalogue de chansons françaises au monde...'),(28,'http://www.canalacademie.com/ida6854-Exclusif-Charles-Aznavour-et-Charles-Trenet-deux-amis-deux-geants-de-la-chanson.html',13,'Aznavour sur le Canal Académie','Charles Aznavour raconte Charles Trenet, à l’occasion des 10 ans de la disparition de ce dernier...'),(29,'http://bibliobs.nouvelobs.com/documents/20120611.OBS8183/johnny-brassens-et-ferre-par-louis-aragon.html',14,'Johnny, Brassens et Ferré... par Louis Aragon','Dans un numéro de la «NRF» consacré à la littérature et à la chanson, on trouve un trésor: un entretien inédit de 1963 avec Aragon sur la chanson. Extraits...'),(30,'http://www.jesuismort.com/biographie_celebrite_chercher/biographie-louis_aragon-1294.php',14,'Biographie de Louis ARAGON','Louis Aragon est né le 3 octobre 1897 à Paris. Il y meurt le 24 décembre 1982. Entre ces deux dates, la vie d’un homme, d’un homme hors du commun...'),(31,'http://www.les-lettres-francaises.fr/2010/11/une-plaque-pour-elsa-triolet-et-louis-aragon/',14,'Les Lettres Françaises.fr','Une plaque pour Elsa Triolet et Louis Aragon...\r\n'),(32,'http://www.lexpress.fr/culture/livre/je-me-souviens-d-aragon_822105.html',14,'Je me souviens d\'Aragon par Jérôme Dupuis','C\'est un événement littéraire: la Pléiade publie les oeuvres poétiques complètes d\'Aragon en deux volumes...'),(33,'http://www.gallimard.fr/Contributeurs/Louis-Aragon',14,'Louis Aragon sur le site web des éditions Gallimard','Né à Paris le 3 octobre 1897, Aragon rencontre Breton et Soupault avec qui il fonde la revue Littérature en 1919...'),(34,'http://la-brochure.over-blog.com/article-neruda-et-aragon-112034591.html',14,'Neruda et Aragon','En 1966 les Editions Gallimard publient, Elégie à Pablo Neruda de Louis Aragon. D’entrée le livre donne « l’argument du poème » après les deux vers de Neruda qui n’ont pas besoin de traduction...'),(35,'http://www.la-pleiade.fr/Catalogue/GALLIMARD/Bibliotheque-de-la-Pleiade/OEuvres-romanesques-completes26',14,'Louis Aragon, oeuvres romanesques compètes','Édition sous la direction de Daniel Bougnoux avec la collaboration de Philippe Forest...'),(36,'http://bibliobs.nouvelobs.com/documents/20121128.OBS0750/aragon-l-ecrivain-qui-preferait-staline-a-proust.html?xtor=RSS-15',14,'Aragon, l\'écrivain qui préférait Staline à Proust','Tandis qu\'on célèbre le 30e anniversaire de la mort d\'Aragon, l\'ancien dirigeant du PCF Pierre Juquin consacre une volumineuse biographie à ce «personnage tragique de la tragédie des communistes». Fabrice Pliskin l\'a rencontré...'),(37,'http://www.cndp.fr/poetes-en-resistance/poetes/louis-aragon/strophes-pour-se-souvenir/pistes-pedagogiques.html',14,'Louis Aragon, « Strophes pour se souvenir »','En 1955, à l’occasion de l’inauguration d’une rue « Groupe Manouchian » à Paris, Louis Aragon écrit le poème « Strophes pour se souvenir », dans lequel il rend hommage à ces résistants « étrangers » arrêtés par les Allemands et fusillés le 21 février 1944...'),(38,'http://www.etudes-litteraires.com/aragon-biographie.php',14,'Louis Aragon (1897-1982)','Louis Aragon est né en octobre 1897 à Paris. Il commence des études de médecine et rencontre, en 1917, à l’hôpital du Val-de-Grâce, André Breton...'),(39,'http://www.lehall.com/galerie/barbara/home.html',15,'Barbara sur le site Le Hall','Présentation de la chanteuse sur le site de l\'association dédié à la chanson française...'),(40,'http://www.liberation.fr/culture/2012/11/30/barbara-s-en-fut-un-soir-en-novembre_864275',15,'Hélène Hazéra raconte Barbara','Dans les archives de «Libé», il y a quinze ans. L’auteure et interprète de «l’Aigle noir» s’est éteinte à 67 ans. Entamée sur le tard, son histoire d’amour avec le public ne s’est jamais démentie...'),(41,'http://www.lemonde.fr/culture/article/2012/11/24/la-memoire-vive-de-barbara-continue-d-irriguer-la-jeune-chanson-francaise_1795518_3246.html',15,'L\'influence de Barbara par Le Monde','La mémoire vive de Barbara continue d\'irriguer la jeune chanson française...\r\n'),(42,'http://lesamisdebarbara.free.fr/',15,'Le site des amis de Barbara','Les Amis de BARBARA, association loi 1901, sans but lucratif et reconnue d\'intérêt général...'),(43,'http://www.universalmusic.fr/barbara/biographie',15,'Sur le site d\'Universal Music','La biographie de la chanteuse sur le site de la maison de disque...'),(44,'http://www.telerama.fr/musique/barbara-notre-plus-belle-histoire-d-amour,89759.php',15,'Dossier Barbara sur telerama.fr','On la reprend, on s\'en inspire, on la cite... Quinze ans après sa disparition, plongée dans la galaxie Barbara, alors que Télérama réédite le hors-série qui lui était consacré...'),(45,'http://www.franceinter.fr/emission-barbara-en-noir-et-blanc-l-enfance-de-barbara',15,'L\'enfance de la chanteuse sur France Inter','L\'enfance de Barbara, née Monique Serf. L\'enfance dans le quartier des Batignolles. Une petite fille qui rêve de piano et de chansons. Les années de fuite durant la guerre...'),(46,'http://www.lexpress.fr/culture/musique/treize-chansons-de-barbara_1190672.html',15,'Les 15 ans de la disparition de Barbara sur l\'Express','Quinze ans après le décès de la Dame en noir, Daphné sort un bel album de reprises...'),(47,'http://www.rfimusique.com/artiste/chanson/barbara/biographie',15,'Barbara sur le site de RFI','Lorsque fin 1997, disparaît Barbara (elle disait détester le mois de novembre), on sent bien que c\'est toute une période de la chanson française qui s\'achève...\r\n'),(48,'http://lesamisdebarbara.free.fr/echosbulletins/echobullautomne19.html',15,'Les amis de Barbara','La lettre des amis de Barbara nous informe...'),(49,'http://bibliobs.nouvelobs.com/les-ecrivains-de-l-obs/20120210.OBS1075/la-correspondance-chessex-garcin.html',11,'La correspondance Chessex-Garcin','Pendant trente-cinq années, de 1975 à 2009, Jérôme Garcin et Jacques Chessex ont été amis. Trois ans après la mort de l\'auteur de \"l\'Ogre\" paraît leur correspondance, sous le titre de \"Fraternité secrète\" (Grasset)...'),(50,'http://www.lejdd.fr/Chroniques/Bernard-Pivot/Une-amitie-improbable-et-vraie-par-Bernard-Pivot-479206',11,'La chronique livres de Bernard Pivot','Deux lettres ont changé la vie de Jérôme Garcin. L’une et l’autre lui ont été dictées par la lecture de livres...\r\n'),(51,'http://www.lexpress.fr/culture/livre/olivier_965433.html',11,'Jérôme Garcin avait un frère','L\'absence d\'Olivier, son jumeau, mort avant ses 6 ans, emplit la vie de Jérôme Garcin. Qui signe ici un livre étincelant...'),(52,'http://www.dailyneuvieme.com/Le-jardin-discret-de-Jerome-Garcin_a1373.html',11,'Le jardin discret de Jérôme Garcin','...\"J\'ai le sentiment de vivre dans deux mondes contradictoires. Et l\'équilibre se situe à la frontière de ces deux activités, le journalisme et l\'écriture.\"...'),(53,'http://www.fondation-apsommer.org/fr/mediation-animale-jerome-garcin,78.html',11,'Jérôme Garcin et le cheval','Depuis la nuit des temps, pour le meilleur et pour le pire, le cheval a été l’indéfectible allié de l’homme...'),(54,'http://www.fabriquedesens.net/Litterature-et-medecine-un',11,'Littérature et médecine : un entretien avec Jérôme Garcin','« Avec ou sans rendez-vous », « Littérature et médecine : un entretien avec Jérôme Garcin », émission de France Culture du 29 décembre 2009, transcription réalisée par Maryse Legrand, psychologue clinicienne...'),(55,'http://monroman.skynetblogs.be/archive/2012/12/24/c-etait-tous-les-jours-tempete-jerome-garcin.html',11,'C\'était tous les jours tempête - Jérôme Garcin','Dès la parution de son premier roman en 1994, d\'aucuns pointaient déjà les conflits d\'intérêts entre son métier de critique littéraire, d\'animateur producteur de l\'émission de radio la plus prescriptrice en matière littéraire, et celui d\'écrivain...'),(56,'http://www.gallimard.fr/catalog/entretiens/01057243.HTM',11,'Jérôme Garcin sur le site de Gallimard','Rencontre avec Jérôme Garcin, à l\'occasion de la parution de Cavalier seul (2006)...'),(57,'http://www.bibliotheque-sonore-caen.fr/2012/09/les-automnales-normandes-rencontre-avec-jerome-garcin/1823',11,'Les automnales normandes : rencontre avec Jérôme Garcin','En octobre 2012, la Bibliothèque de Caen inaugure un festival, Les Automnales normandes, qui chaque année prendra pour thème l’œuvre d’une personnalité littéraire liée à la Normandie...'),(58,'http://www.la-croix.com/Culture/Actualite/Des-hommes-et-des-dieux-la-fraternite-a-l-etat-pur-_NG_-2011-02-26-578006',8,'« Des hommes et des dieux », la fraternité à l\'état pur','César du meilleur film français, Grand prix du jury au Festival de Cannes, cette évocation de la vie et de l\'engagement des moines de Tibhirine est un grand moment de cinéma.'),(59,'http://editionslevistemboir.com/editions/spip.php?article14',8,'Journal d’un tournage - DES HOMMES ET DES DIEUX - Jean-Marie Frin','Ce journal, écrit pendant le tournage du film de Xavier Beauvois \" Des hommes et des dieux \" (l’assassinat des moines du monastère de Tibhirine en Algérie), permet une approche rare du métier d’acteur.'),(60,'http://television.telerama.fr/tele/films/des-hommes-et-des-dieux,16136322.php',8,'La critique de Télérama','Dans les années 90, des moines cisterciens vivent dans un prieuré d\'un village isolé au milieu des montagnes algériennes.'),(61,'http://www.lemonde.fr/festival-de-cannes/article/2010/05/19/des-hommes-et-des-dieux-la-montee-vers-le-martyre-des-moines-de-tibehirine_1353761_766360.html',8,'La montée vers le martyre des moines de Tibéhirine seln Le Monde','Le 26 mars 1996, durant le conflit qui oppose l\'Etat algérien à la guérilla islamiste, sept moines français installés dans le monastère de Tibéhirine, dans les montagnes de l\'Atlas, sont enlevés par un groupe armé.'),(62,'http://www.paroisse-croixdevalchevriere-cathisere.cef.fr/site/Des-hommes-et-des-dieux.html',8,'Le film Des hommes et des dieux a un immense retentissement','Vous pouvez relire ici le texte du Testament de Dom Christian de Chergé, ou le télécharger pour l’imprimer.'),(63,'http://www.lepoint.fr/culture/des-hommes-et-des-dieux-de-la-grace-et-des-larmes-02-09-2010-1231576_3.php',8,'\"Des hommes et des dieux\", de la grâce et des larmes','Sans la tragédie des moines assassinés à Tibéhirine en mai 1996, jamais, bien sûr, le cinéma ne se serait intéressé à ces religieux.'),(64,'http://www.lesinrocks.com/cinema/films-a-l-affiche/des-hommes-et-des-dieux-le-film-de-la-grace/',8,'Des hommes et des dieux, le film de la grâce','Autour de l’assassinat encore non élucidés des moines de Tibhirine, Xavier Beauvois crée une fresque métaphysique lente et inspirée.'),(65,'http://www.rue89.com/la-bande-du-cine/2010/09/08/des-hommes-et-des-dieux-du-bure-genie-165783',8,'« Des hommes et des dieux » : du bure génie ?','Les films consacrés à des événements qui sont dans toutes les mémoires sont toujours délicats.'),(66,'http://www.lexpress.fr/culture/cinema/michael-lonsdale-je-suis-plus-heureux-aujourd-hui-que-jamais_976166.html',8,'Michael Lonsdale \"Je suis plus heureux aujourd\'hui que jamais\"','L\'acteur chrétien explique sa proximité avec le vrai Luc, ce moine médecin de la communauté Tibéhirine, qu\'il interprète dans Des hommes et des dieux.'),(67,'http://www.dominicain.net/des-hommes-et-des-dieux.php',8,'Point de vue des Dominicains','Dans la nuit du 26 au 27 mars 1996, les moines cisterciens de Tibhirine dans l’Atlas algérien, sont kidnappés et tués.'),(68,'http://www.lefigaro.fr/cinema/2012/09/10/03002-20120910ARTFIG00434--intouchables-film-francais-le-plus-vu-dans-le-monde.php',17,'Intouchables, film français le plus vu dans le monde','Avec 23,1 millions d\'entrées, la comédie vient de battre le record, détenu jusqu\'à présent par Le Fabuleux Destin d\'Amélie Poulain, du long-métrage français le plus regardé à l\'étranger...\r\n'),(69,'http://television.telerama.fr/tele/films/intouchables,29464803.php',17,'La critique TV de Télérama du 15/12/2012','Après leur triomphe, est-il encore besoin de présenter ces Intouchables ? L\'un est blanc, l\'autre noir. L\'un ­habite un hôtel particulier à Paris, l\'autre n\'a plus droit de cité dans son HLM de banlieue. Ils se rencontrent et deviennent de formidables copains...'),(70,'http://www.lemonde.fr/culture/article/2012/09/09/intouchables-devient-le-film-francais-le-plus-vu-au-monde_1757700_3246.html',17,'\"Intouchables\" devient le film français le plus vu au monde','Intouchables vient de battre le record détenu par Amélie Poulain du film français le plus vu à l\'étranger, passant le seuil des 23,1 millions d\'entrées dans les salles obscures à travers le monde, selon UniFrance, l\'organisme chargé de promouvoir l\'exportation du cinéma français...'),(71,'http://www.lemonde.fr/cinema/article/2011/11/01/intouchables-derriere-la-comedie-populaire-une-metaphore-sociale-genereuse_1596827_3476.html',17,'\"Intouchables\" : derrière la comédie populaire, une métaphore sociale généreuse','A en croire les échos, un gros buzz entoure la sortie nationale d\'Intouchables, quatrième long métrage d\'Olivier Nakache et Eric Toledano...'),(72,'http://www.lesinrocks.com/cinema/films-a-l-affiche/intouchables-une-fable-relou-et-demagogique/',17,'“Intouchables”, une fable relou et démagogique','Intouchable s’apparente à un croisement inattendu de Joséphine ange gardien et du Service après-vente...'),(73,'http://www.lexpress.fr/culture/cinema/intouchables-la-critique_1046777.html',17,'Comme dans un fauteuil','Tolédano et Nakache font du cinéma à l\'humour assumé. Ca fait plaisir...\r\n'),(74,'http://www.lexpress.fr/culture/cinema/qui-a-envoye-intouchables-aux-oscars_1163372.html',17,'Qui a envoyé Intouchables aux Oscars?','L\'annonce de la sélection d\'Intouchables comme représentant de la France pour les Oscars 2013 a surpris tout le monde...'),(75,'http://culturevisuelle.org/luciddreams/archives/293',17,'Bienvenue chez les Intouchables… notes sur la prosécogénie d’un film…','Salles combles une heure avant la séance, rires francs, unanimes et généreux pendant la projection, émotion et silence recueilli à la fin, quand Driss s’éloigne, et applaudissements aux images des modèles réels qui ont inspiré le film mais aussi et surtout au moment où les noms des comédiens apparaissent au générique...'),(76,'http://www.lemonde.fr/culture/article/2012/03/03/intouchables-touchera-t-il-les-americains_1651450_3246.html',17,'\"Intouchables\" touchera-t-il les Américains ?','Des rires et des applaudissements ont accueilli la première américaine d\'Intouchables, jeudi 1er mars, à New York, en ouverture de l\'annuel Rendez-Vous With French Cinema, au Lincoln Center...'),(77,'http://www.enquete-debat.fr/archives/intouchables-symbole-de-la-france-handicapee-et-assistee-31092',17,'Intouchables : symbole de la France handicapée et assistée','Nul ne peut échapper au tsunami émotionnel qui submerge la France depuis 1 mois (11 millions d’entrées à ce jour), vous aurez deviné qu’il s’agit du film Intouchables dont nous allons parler...'),(78,'http://archives-lepost.huffingtonpost.fr/article/2011/11/06/2631674_intouchables-combien-les-journalistes-ont-ils-touche-pour-dire-autant-de-bien-de-ce-film.html',17,'Intouchables : mais pourquoi tous les médias aiment ce film ?','Sans doute comme des dizaines de milliers de Français, je suis allé voir ce week-end le film Intouchables d\'Eric Toledano et Olivier Nakache...'),(79,'http://www.alainbashung.fr/',18,'L\'homme à la tête de chou','Site officiel du chanteur produit par Universal Music. '),(80,'http://www.bashung.fr/',18,'Alain Bashung par les fans','Site non officiel consacré au chanteur mais très complet et avec de multiples rubriques... '),(81,'http://www.telerama.fr/musique/plus-rien-ne-s-oppose-a-la-nuit,40931.php',18,'L\'hommage de Télérama','On a déjà longuement évoqué le parcours d’Alain Bashung sur ce site. Aujourd’hui, c’est “Télérama” version papier qui prend le relais...'),(82,'http://www.liberation.fr/mort-bashung,99779',18,'Sommaire d\'articles dans Libération','Recueillement et applaudissements lors de l’ultime hommage au musicien, désormais résident du Père-Lachaise...'),(83,'http://www.lefigaro.fr/musique/2008/06/13/03006-20080613ARTFIG00323-le-miracle-alain-bashung.php',18,'Le miracle Alain Bashung','À l\'Olympia et en tournée (2008). Il y a un miracle Alain Bashung, un miracle qui met le rock le plus dru aux couleurs de la poésie française la plus exigeante...\r\n'),(84,'http://www.lesinrocks.com/2009/09/16/musique/bashung-les-secrets-dune-vie-1137407/',18,'Bashung : les secrets d’une vie','La vie inouïe d’Alain Bashung racontée dans une biographie pudique mais sans langue de bois...'),(85,'http://www.lemonde.fr/culture/video/2012/06/21/un-square-alain-bashung-inaugure-a-paris_1722758_3246.html',18,'Un square au nom d\'Alain Bashung','Décédé le 14 mars 2009, le chanteur, qui habitait l\'arrondissement, près de la Goutte-d\'Or, était très impliqué dans la vie des associations locales...'),(86,'http://www.lemonde.fr/culture/article/2009/03/01/bashung-triomphe-aux-victoires-de-la-musique_1161852_3246.html',18,'Bashung triomphe aux Victoires de la musique','Les 24e Victoires de la musique ont été un triomphe pour Alain Bashung, qui est devenu, samedi 28 février, l\'artiste le plus primé de l\'histoire de la cérémonie en remportant trois trophées dont celui de l\'interprète masculin de l\'année...'),(87,'http://www.arte.tv/fr/alain-bashung-faisons-envie/3836466,CmC=3836468.html',18,'Alain Bashung, faisons envie','Une évocation inspirée du chanteur de \"La nuit je mens\", à travers les voix de l\'album hommage Tels : Christophe, Vanessa Paradis, -M-, Gaëtan Roussel, les BB Brunes...\r\n'),(88,'http://www.lemondedephilippe.com/article-29048686.html',18,'Bashung selon un fan','Ce matin « Bleu pétrole », c’était la gueule de bois...'),(89,'http://www.telerama.fr/scenes/hermes-le-corbusier-et-le-luxe-veritable,87412.php',19,'Hermes selon Le Corbusier','Deux planches en noir et blanc extraites du livre L’Art décoratif d’aujourd’hui, écrit par l’architecte Le Corbusier en 1925...'),(90,'http://www.fondationlecorbusier.fr/corbuweb/morpheus.aspx?sysName=home&sysLanguage=fr-fr&sysInfos=1',19,'Fondation Le Corbusier','Conformément à ses statuts et à ses missions consacre l’ensemble de ses moyens à la conservation, à la connaissance et à la diffusion de l’œuvre de Le Corbusier...'),(91,'http://www.amis-de-le-corbusier.fr/amis-de-le-corbusier',19,'Les amis de Le Corbusier','Portail de l\'association et des différents sites bâtis par Le Corbusier, le site des Amis de Le Corbusier...\r\n\r\n\r\n'),(92,'http://www.letemps.ch/Page/Uuid/32629646-05c3-11e2-831a-14992fc03de0/Le_Corbusier_une_ma%C3%AEtrise_du_monde',19,'Article dans Le Temps','Le Corbusier, une maîtrise du monde...\r\n'),(93,'http://tempsreel.nouvelobs.com/societe/20121012.AFP1887/la-cite-radieuse-de-le-corbusier-60-ans-et-une-aventure-qui-seduit-toujours.html',19,'La Cité radieuse de Le Co