ues, stratégiques, religieuses et humaines...'),(137,'https://www.monde-diplomatique.fr/1987/01/GRESH/39722',24,'Jeux de go en Méditerranée orientale','Analyser en un seul ouvrage l’affrontement américano-soviétique en Méditerranée, le conflit gréco-turc, les menaces qui pèsent sur les Balkans, la question chypriote, la poussée islamiste et le rôle des divers protagonistes, petits ou grands, qui contribuent à façonner la région, relevait de la gageure...');
